exports.test = (word) => {
  var i, j, prefix, position;
  var wordRev = reverse(word);
  var fwdStart = 1;
  var fwdEnd = 20;
  var revStart = 1;
  var revEnd = 20;
  var maxMatchFwd = 0;
  var maxMatchRev = 0;
  var result = false;

  // Find highest matching prefix length - word
  for (i = fwdStart; i <= fwdEnd; i++) {
    if (wordlist.fwd.hasOwnProperty(i)) {
      for (j = 0; j < wordlist.fwd[i].length; j++) {
        prefix = wordlist.fwd[i][j];
        position = word.indexOf(prefix);

        // Mark highest matching prefix
        if (position === 0) {
          maxMatchFwd = i;
        }
      }
    }
  }

  // Find highest matching prefix length - word reversed
  for (i = revStart; i <= revEnd; i++) {
    if (wordlist.fwd.hasOwnProperty(i)) {
      for (j = 0; j < wordlist.rev[i].length; j++) {
        prefix = wordlist.rev[i][j];
        position = wordRev.indexOf(prefix);

        // Mark highest matching prefix
        if (position === 0) {
          maxMatchRev = i;
        }
      }
    }
  }

  var matchedLength = maxMatchFwd + maxMatchRev;
  var wordLengthTolerance = parseInt(word.length * 0.7);

  if (wordLengthTolerance <= matchedLength) {
    result = true;
  }

  return result;
};
